import React from "react";
import { Container,Row,Col } from "react-bootstrap";
import Catigories from "./Catigories";

const CatigoriesList = ({category,filterbycategory}) => {

    const onFilter = (caty) => {
        filterbycategory(caty)
    }
    return(
        <Row className="mt-3">
            <h1 className="CategoriesTitle text-center">categories</h1>
           {
            category.map((cat)=>{
                return(
                    <Catigories onClick={() => onFilter(cat.strCategory)} cat={cat} key={cat.idCategory}/>
                )
            })
           }
        </Row>
    )
}
export default CatigoriesList;
